																	//направить на регистрацию
(function(){
    var i,
        outgoing = stm_document, //исходящий документ
        registrars = edsGlobalSettings.getRegistrars("DA_REGISTRARS", outgoing),//получение списка регистраторов по документу
        registrarsCount = registrars.length,
        notification;
    //раздаем права регистраторам
    for(i = 0; i < registrarsCount; ++i) {
        statemachine.grandDynamicRoleForEmployee(outgoing, registrars[i], "DA_REGISTRAR_DYN", task);
    }
    //подготавливаем уведомление
    notification = outgoingStatemachine.prepareNotificationAboutRegistration(outgoing, registrars);
    //рассылаем уведомление
    notifications.sendNotification(notification);
})();

																	// пришло с "Подписать и направить"
(function() {
    var previousStatusName =  statemachine.getPreviousStatusName(stm_document),
        currentEmployee, resultList, taskDecision;

    if (previousStatusName == "Проект" || previousStatusName == "На доработке" || previousStatusName == "Согласован") {
        currentEmployee = orgstructure.getCurrentEmployee();

        resultList = signingWorkflow.createEmptyResultList(bpm_package, "Внутренний");
        signingWorkflow.createResultItem(resultList, currentEmployee);

        taskDecision = signingWorkflow.getSignedDecision(currentEmployee);
        signingWorkflow.logDecision(resultList, taskDecision);

        signingWorkflow.deleteTempAssigneesList(execution);

        signingWorkflow.addSignBusinessJournalRecord(bpm_package, currentEmployee);
    }
})();

